const categorylist = [
  { image: "./logo192.png", title: "cabbage" },
  { image: "./logo192.png", title: "Galic" },
  { image: "./logo192.png", title: "Apple" },
];
const CategoryBar = () => {
  return (
    <div className="flex w-full bg-grey">
      <div className="grid place-items-center m-3"></div>
    </div>
  );
};

export default CategoryBar;

const Category = categorylist.map((category) => <div></div>);
